import React from 'react';
import './Flights.css';

function Flights(props) { 

    return(
        <div className="flights">
            <table>
                <thead>
                    <tr>
                        <th>Airport ID</th>
                        <th>Airport Name</th>
                        <th>Country ID</th>
                        <th>Region ID</th>
                        <th>City ID</th>
                        <th>Country Name</th>
                    </tr>
                </thead>
                <tbody>
                    {props.flights.map(flight => {
                        return (<tr id={flight.QuoteId}>
                            <th>{flight.MinPrice}</th>
                            <th>{flight.Direct}</th>
                            {/* <th>{flight.OutboundLeg.CarrierIds}</th> */}
                        </tr>)
                    })}
                </tbody>
            </table>
         </div>
    )
}

export default Flights;
